void egg_set_debug (int  _bdebug )
{
        egg__flex_debug = _bdebug ;
}

static int yy_init_globals (void)
{
        /* Initialization is the same as for the non-reentrant scanner.
     * This function is called from egg_lex_destroy(), so don't allocate here.
     */

    (yy_buffer_stack) = 0;
    (yy_buffer_stack_top) = 0;
    (yy_buffer_stack_max) = 0;
    (yy_c_buf_p) = (char *) 0;
    (yy_init) = 0;
    (yy_start) = 0;

/* Defined in main.c */
#ifdef YY_STDINIT
    egg_in = stdin;
    egg_out = stdout;
#else
    egg_in = (FILE *) 0;
    egg_out = (FILE *) 0;
#endif

    /* For future reference: Set errno on error, since we are called by
     * egg_lex_init()
     */
    return 0;
}

/* egg_lex_destroy is for both reentrant and non-reentrant scanners. */
int egg_lex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		egg__delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		egg_pop_buffer_state();
	}

	/* Destroy the stack itself. */
	egg_free((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * egg_lex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

